import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css/autoplay";
// Import Swiper styles
import "swiper/css";
import "swiper/css/navigation";
import "swiper/css/pagination";
import "swiper/css/scrollbar";
import { Autoplay, Pagination, Navigation } from "swiper";
import Rectangle16 from "../assets/Rectangle-16.png";
import Rectangle17 from "../assets/Rectangle-17.png";
import Rectangle19 from "../assets/Rectangle-19.png";


export default function FeaturedStays() {
  return (
    <div className="featured_main">
      <div className="featured-area">
        <span className="text-heading">Featured Stays</span>
        <br />
        <span className="text-desc">
          Beachfront villas to high rise apartments and penthouses,<br /> experience
          your next stay with Stella.
        </span>

        <Swiper
        spaceBetween={0}
        slidesPerView={1}
        autoplay={{ delay: 3000, disableOnInteraction: false }}
        onSlideChange={() => console.log("slide change")}
        onSwiper={(swiper) => console.log(swiper)}
        modules={[Autoplay]}
      >
        <SwiperSlide>
          <img src={Rectangle16} alt="heroimage" />
          <div>
            <span>
              Escape <br />
              the ordinary
            </span>
          </div>
        </SwiperSlide>
        <SwiperSlide>
          <img src={Rectangle17} alt="heroimage" />
        </SwiperSlide>
        <SwiperSlide>
          <img src={Rectangle19} alt="heroimage" />
        </SwiperSlide>
      </Swiper>
      </div>
    </div>
  );
}
